import imgg from '../imgg.jpg';
import '../../App.css';

export default function About() {

  return (
      <div className="grid grid-cols-2 gap-10">
       <div className='justify-items-center grid grid-rows-3 m-6'>
        <h1 className='font-serif text-2xl'>
            dwqd
        </h1>
        <div>
dwq
        </div>
       </div>
       <img  className="img brightness-75" src={imgg} alt="img"/>
       <Particle />
    </div>
  );
}
